[DoctorAdventures] Kristal Summers, Veronica Avluv (Veronica Loves to Play Doctor / 4.10.2012)

Kristal Summers is the Editor-in-Chief of the local Newspaper, but When Johnny, her Journalist, Goes missing at an Insane Asylum she decides to do some Deep Investigating. All is not as IT Seems When she Finds while Johnny &quot;Dr. Avluv&quot; decides to Play Doctor and examine the two Thoroughly.

